import React from "react";
import Weather from "./weather";
import Fullpage from "./fullweatherpage";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/weather" element={<Weather />} />
        <Route path="/fullweatherpage" element={<Fullpage />} />
      </Routes>
    </Router>


  );
}

export default App;
